import React from 'react';
import '../../Header.css';
import bars from '../../../../img/bars-solid.svg';

class Menu extends React.Component{
    constructor(props){
        super(props);
    }

    render(){
        return  <div className="navbar">
                    <button><img src={bars} alt="fa-bars" /></button>
                    <h1>{this.props.status}</h1>
                </div>  
    } 
}

export default Menu;
